import React from 'react';

const products = [
    {
        id: 1,
        name: 'adidas',
        price: 15,
        originalPrice: 20,
        category: 'electronic',
        imgSrc: './image/vert.avif',
        videoSrc: './video/video.mp4',
        description: (
            <>
                ✅Un plat de <span style={{ color: 'red' }}>spaghettis</span> savoureux avec sauce maison
            </>
        ),
        modalDescription: 'Our special spaghetti with fresh ingredients and homemade sauce\n Our special spaghetti with fresh ingredients and homemade sauce\n Our special spaghetti with fresh ingredients and homemade sauce\n Our special spaghetti with fresh ingredients and homemade sauce\nOur special spaghetti with fresh ingredients and homemade sauce'
    },
    {
        id: 2,
        name: 'Nike air',
        price: 15,
        category: 'traditionnel',
        description: 'Nike Aire max pointure valide\n Pointure 37-49',
        modalDescription: '✅ Nike Aire max pointure valide\n ✅ Pointure 37-49',
        imgSrc: './image/nike.jpg',
        videoSrc: './video/nike.mp4'
    },
    {
        id: 3,
        name: 'Sauce verte',
        price: 15,
        category: 'traditionnel',
        imgSrc: './image/menu-4.png'
    },
    {
        id: 4,
        name: 'Riz blanc',
        price: 15,
        category: 'traditionnel',
        imgSrc: './image/menu-5.png'
    },
    {
        id: 5,
        name: 'Plat Vegan',
        price: 10,
        category: 'vegan',
        imgSrc: './image/menus.jpg'
    },
    {
        id: 6,
        name: 'Dessert',
        price: 5,
        category: 'dessert',
        imgSrc: './image/dessert.jpg'
    },
    {
        id: 7,
        name: 'Dessert',
        price: 5,
        category: 'dessert',
        imgSrc: './image/dessert.jpg'
    },
    {
        id: 8,
        name: 'Dessert',
        price: 5,
        category: 'dessert',
        imgSrc: './image/dessert.jpg'
    }
];

const ProductList = () => (
    <div>
        {products.map((product) => (
            <div key={product.id}>
                <h2>{product.name}</h2>
                <p>{product.price} €</p>
                <p>{product.description}</p>
                <img src={product.imgSrc} alt={product.name} />
                {/* Si besoin, ajouter d'autres détails comme les vidéos */}
            </div>
        ))}
    </div>
);

export default ProductList;
